import React from 'react';
import {
    BrowserRouter as Router,
    Link,
    Route
} from "react-router-dom";

import Header, {HeaderReports} from './Header.js';
import Week from "./Week.js";


class Report extends React.Component {
    render() {
        return (
            <article className="article">
                <div className="report-page">
                    <h2>REPORT PAGE</h2>
                    <HeaderReports/>

                    // TODO GÖr om till en egen komponent ??
                    // TODO Snyggare routing. Mer dynamsik?
                    // TODO för att slippa impotera alla? kanske kommer bli bättre när datan är sparad i en databas

                    <Router>
                        <div className="report_content">
                            <Route path="/reports/week/1" component={Week}/>
                            <Route path="/reports/week/2" component={Week}/>
                            <Route path="/reports/week/3" component={Week}/>
                            <Route path="/reports/week/4" component={Week}/>
                            <Route path="/reports/week/5" component={Week}/>
                            <Route path="/reports/week/6" component={Week}/>
                            <Route path="/reports/week/7" component={Week}/>
                        </div>
                    </Router>
                </div>
            </article>
        )
    }
}

export default Report;
